import React, {Component} from 'react';
import {Link} from "react-router-dom";
import './ready.css';

import BackImg from "../../images/left-close.svg";
import PlaneVector from '../../images/plane-vector.svg';

class Ready extends Component {
    render () {
        return (
            <div className="ready-container">
                <div className="back-btn"> {/* Back Button */}
                    <Link to="/character">
                        <img src={ BackImg } alt=""/>
                    </Link>
                </div> {/* End of Back Button */}

                <h2>All Set!</h2>
                <p>Get ready to start the adventure and collect as many points as you can</p>

                <button className="basic-btn start-adventure">
                    <h3>Start the Adventure</h3>
                </button>

                <img src={PlaneVector} alt=""/>

                <button className="basic-btn guide-btn">
                    <h3>Guide</h3>
                </button>
            </div>
        );
    }
}

export default Ready;
